import React, { Component } from 'react';
import {AppBar,MuiThemeProvider ,TextField,RaisedButton} from 'material-ui';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';

const styles = theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing.unit,
  },
  withoutLabel: {
    marginTop: theme.spacing.unit * 3,
  },
  textField: {
    flexBasis: 200,
  },
  card: {
    maxWidth: 445,
  },
  button : {
    margin : 15
  }
});

class RideDetails extends Component {
  
    continue = e => {
        e.preventDefault();
        this.props.nextStep();
    }

    render() {
        const { classes,handleChange,values} = this.props; 
        return ( 
          <div className={"boodDeliveryMainDiv"}>
            <Card className={classes.card + " card "}>
            <MuiThemeProvider>
                    <React.Fragment>
                        <AppBar title="Basic Details" />
                        <TextField 
                        hintText = "Enter The First Name"
                        floatingLabelText="First Name"
                        onChange = {handleChange('firstName')}
                        defaultValue = {values.firstName}/>
                        <br/>
                        <TextField 
                        hintText = "Enter The Last Name"
                        floatingLabelText="Last Name"
                        onChange = {handleChange('lastName')}
                        defaultValue = {values.lastName}/>
                        <br/>
                        <TextField 
                        hintText = "Enter The Email"
                        floatingLabelText="Email"
                        onChange = {handleChange('email')}
                        defaultValue = {values.email}/>
                        <br/>

                        <RaisedButton 
                        label = "Continue"
                        primary = {true}
                        style = {styles.button}
                        onClick = {this.continue}/>
                    </React.Fragment>
                    {/* <input type="text" values = {values.firstName} onChange ={handleChange('firstName')}/> */}
                </MuiThemeProvider>                  
            </Card>
          
          </div>
          
        );

    }
}
export default RideDetails;
